import { useEffect, useState } from "react";
import { ImageType } from "../components/image-carousel";
import ImageCarouseli from '../components/image-carousel'
import "./Carousel.css";

const Carouseli = () => {
  const [images, setImages] = useState<ImageType[]>();

  useEffect(() => {
    setImages(
      Array.from(Array(10).keys()).map((id) => ({
        id,
        url: `https://picsum.photos/1000?random=${id}`
      }))
    );
  }, []);

  return (
    <div className="App">
      <ImageCarouseli images={images} />
    </div>
  );
}

export default Carouseli;
